func getHTMLZipDimensionsGoogleWebDesigner(
	fileBase64 string, //This must be a standard encoding base64 string
) (int, int, error) {

	file, err := createZipFileFromBase64(fileBase64)
	if err != nil {
		fmt.Println(err)
	}

	//Open the zip file
	read, err := zip.OpenReader(file.Name())
	if err != nil {
		fmt.Println(err)
	}
	defer read.Close()

	//Regexp Patterns
	googleWebDesignWidthPattern := regexp.MustCompile(`data-gwd-width="(.*?)"`)
	googleWebDesignHeightPattern := regexp.MustCompile(`data-gwd-height="(.*?)"`)
	insideDoubleQuotesPattern := regexp.MustCompile(`"(.*)"`)

	var width, height int

	for _, file := range read.File {
		//Check if the file is an html file
		if isFileHTML(file.Name) {
			openHTMLFile, _ := file.Open()
			scanner := bufio.NewScanner(openHTMLFile)
			//For each line in the html file
			for scanner.Scan() {
				matchedWidth := googleWebDesignWidthPattern.FindString(scanner.Text())
				if matchedWidth != "" {
					//indexes of where the google web design width pattern is located in the current line
					widthIndexes := googleWebDesignWidthPattern.FindStringIndex(scanner.Text())
					widthText := scanner.Text()[widthIndexes[0]:widthIndexes[1]]
					//Trim down to just the first set of double quoates after googleWebDesignWidthPattern
					widthIndexesQuotes := insideDoubleQuotesPattern.FindStringIndex(widthText)
					widthWithPixels := widthText[widthIndexesQuotes[0]:widthIndexesQuotes[1]]
					//Take of the px from the string
					widthString := widthWithPixels[1 : len(widthWithPixels)-3]
					width, err = strconv.Atoi(widthString)
					if err != nil {
						return 0, 0, err
					}

					heightIndexes := googleWebDesignHeightPattern.FindStringIndex(scanner.Text())
					heightText := scanner.Text()[heightIndexes[0]:heightIndexes[1]]
					heightIndexesQuotes := insideDoubleQuotesPattern.FindStringIndex(heightText)
					heightWithPixels := heightText[heightIndexesQuotes[0]:heightIndexesQuotes[1]]
					heightString := heightWithPixels[1 : len(heightWithPixels)-3]
					height, err = strconv.Atoi(heightString)
					if err != nil {
						return 0, 0, err
					}
					return width, height, nil
				}
			}
		}
	}
	return 0, 0, nil
}

func getHTMLZipDimensionsFromMetaTag(fileBase64 string) (int, int, error) {
	file, err := createZipFileFromBase64(fileBase64)
	if err != nil {
		fmt.Println(err)
	}
	//Open the zip file
	read, err := zip.OpenReader(file.Name())
	if err != nil {
		fmt.Println(err)
	}
	defer read.Close()

	//Regexp Patterns
	metaPattern := regexp.MustCompile(`meta`)
	//Content Patterns
	contentPattern := regexp.MustCompile(`content="(.*?)"`)
	contentWidthPattern := regexp.MustCompile(`width=(.*?),`)
	contentHeightPattern := regexp.MustCompile(`height=(.*?)"`)
	insideEqualAndCommaPattern := regexp.MustCompile(`=(.*),`)
	insideEqualAndQuotePattern := regexp.MustCompile(`=(.*)"`)

	var width, height int

	for _, file := range read.File {
		if isFileHTML(file.Name) {
			openHTMLFile, _ := file.Open()
			scanner := bufio.NewScanner(openHTMLFile)
			for scanner.Scan() {
				//is the line a meta tag?
				matchedMeta := metaPattern.FindString(scanner.Text())
				if matchedMeta != "" {
					//Does the meta tag have a content attribute
					contentIndex := contentPattern.FindStringIndex(scanner.Text())
					if len(contentIndex) > 0 {
						contentText := scanner.Text()[contentIndex[0]:contentIndex[1]]
						contentWidthIndex := contentWidthPattern.FindStringIndex(contentText)
						if len(contentWidthIndex) > 0 {
							//Does the content attribute contain a width property?
							insideEqualAndCommaText := insideEqualAndCommaPattern.FindString(contentText[contentWidthIndex[0]:contentWidthIndex[1]])
							width, err = strconv.Atoi(insideEqualAndCommaText[1 : len(insideEqualAndCommaText)-1])
							if err != nil {
								return 0, 0, err
							}
						}
						contentHeightIndex := contentHeightPattern.FindStringIndex(contentText)
						if len(contentHeightIndex) > 0 {
							//Does the content attribute contain a height property
							insideEqualAndQuoteText := insideEqualAndQuotePattern.FindString(contentText[contentHeightIndex[0]:contentHeightIndex[1]])
							height, err = strconv.Atoi(insideEqualAndQuoteText[1 : len(insideEqualAndQuoteText)-1])
							if err != nil {
								return 0, 0, err
							}
						}
						return width, height, nil
					}
				}
			}
		}
	}
	return 0, 0, nil
}

func isFileHTML(fileName string) bool {
	if filepath.Ext(fileName) == ".html" && fileName[:8] != "__MACOSX" {
		return true
	}
	return false
}

func createZipFileFromBase64(fileBase64 string) (*os.File, error) {
	//Turn base64 string into a slice of bytes
	dec, err := base64.StdEncoding.DecodeString(fileBase64)
	if err != nil {
		return nil, err
	}

	//Create a temporary zip file
	file, err := ioutil.TempFile("", "temp_creative*.zip")
	if err != nil {
		return nil, err
	}

	//Write the above slice of bytes to the zip file
	_, err = file.Write(dec)
	if err != nil {
		return nil, err
	}

	return file, nil
}
